import React from 'react';
import {FaCheckDouble} from 'react-icons/fa';

const NavBar = (props) => {
    return(
        <nav class="navbar mb-5 py-2">
            <a class="navbar-brand m-0 p-0" href="#">do.ly<FaCheckDouble /></a>
            <button class={`${props.user ? '' : 'd-none'} btn mr-1 dropdown-toggle`}></button>
            <button class={`${props.user ? '' : 'd-none'} btn mr-1 log-out`} onClick={() => props.logOut()}>Log Out</button>
        </nav>
    )
}

export default NavBar
